function Footer(){
    const temp = useContext(PrContent)
    const {cardFlipped} = temp;

    return(
        <>
        {cardFlipped && (<div className={styles.box}></div>)}
        
        <div className={styles.container}>
            푸터 입니다.!@!
        </div>
        </>
    )
}

export default Footer;
